package ImageHoster;

import org.springframework.stereotype.Component;

@Component
public class HardCodedImage {
    String drStrange = "";
    String spiderMan = "";

    public HardCodedImage() {
    }

    public String getDrStrange() {
        return drStrange;
    }

    public void setDrStrange(String drStrange) {
        this.drStrange = drStrange;
    }

    public String getSpiderMan() {
        return spiderMan;
    }

    public void setSpiderMan(String spiderMan) {
        this.spiderMan = spiderMan;
    }
}
